import styles from "../assets/NavBarMenu.module.css"

function NavBarMenu() {
  return (
    <ul className={styles.navBarContainer}>
      <li>
        <a>Home</a>
      </li>
      <li>
        <a>Shows</a>
      </li>
      <li>
        <a>Contact</a>
      </li>
      <li>
        <a>About</a>
      </li>
    </ul>
  );
}

export default NavBarMenu;
